import React from "react";
import "../assets/css/Error.css";
import Img12345 from "../assets/img/Grupo_12345.png";
import Img3453 from "../assets/img/Grupo_3453.png";

function Error() {
  return (
    <div className="ErrorCon">
      <button>
        <img src={Img12345} alt="" />
      </button>
      <div className="BacGra">
        <img src={Img3453} alt="" />
        <h1>ERROR 404</h1>
        <button>¡Alguien abrió la puerta que no era!</button>
        <p>
          No te preocupes, en este laboratorio la curiosidad no es pecado. Aquí
          tienes la llave de la puerta principal.
        </p>
      </div>
    </div>
  );
}

export default Error;
